import React from 'react'
import './sidebar.css';

function SidebarBottom() {
    return (
        <>
            <div className="user">
                <div className="imageWrapper">
                    <img src="assets/images/profile1.jpg" alt="" className="img2" />
                    <span className="spanText">Safeer Ahmed</span>
                </div>
            </div>  
        </>
    )
}

export default SidebarBottom
